import React, { useState, useEffect } from "react";
import { FaMoon, FaSun, FaBars, FaTimes } from "react-icons/fa";
import "./Navbar.css";

function Navbar() {
  const [darkMode, setDarkMode] = useState(false);
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleDarkMode = () => setDarkMode(!darkMode);
  const toggleMenu = () => setMenuOpen(!menuOpen);

  useEffect(() => {
    document.body.className = darkMode ? "dark-mode" : "";
  }, [darkMode]);

  return (
    <header className="main-header sticky-top">
      <div className="nav-container">
        <div className="logo-area">
          <a href="#hero" className="logo">Sawera<span>Dev</span></a>
        </div>

        <nav className={`navbar ${menuOpen ? "active" : ""}`}>
  <div className="logo-area">
    <a href="/" className="logo">
      Portfolio <span>Dev</span>
    </a>
  </div>

  <div className={`nav-center ${menuOpen ? "active" : ""}`}>
    <ul className="nav-links">
      <li><a href="#hero" onClick={() => setMenuOpen(false)}>Home</a></li>
      <li><a href="#about" onClick={() => setMenuOpen(false)}>About</a></li>
      <li><a href="#resume" onClick={() => setMenuOpen(false)}>Resume</a></li>
      <li><a href="#portfolio" onClick={() => setMenuOpen(false)}>Portfolio</a></li>
      <li><a href="#services" onClick={() => setMenuOpen(false)}>Services</a></li>
      <li><a href="#contact" onClick={() => setMenuOpen(false)}>Contact</a></li>
    </ul>

    {/* Close icon */}
    <button onClick={toggleMenu} className="menu-btn close-btn">
      {menuOpen ? <FaTimes /> : null}
    </button>
  </div>

  <div className="nav-actions">
    <button onClick={toggleDarkMode} className="mode-btn">
      {darkMode ? <FaSun /> : <FaMoon />}
    </button>
    <button onClick={toggleMenu} className="menu-btn">
      {menuOpen ? null : <FaBars />}
    </button>
  </div>
</nav>



        <div className="nav-actions">
          <button onClick={toggleDarkMode} className="mode-btn">
            {darkMode ? <FaSun /> : <FaMoon />}
          </button>
          <button onClick={toggleMenu} className="menu-btn">
            {menuOpen ? <FaTimes /> : <FaBars />}
          </button>
        </div>
      </div>
    </header>
  );
}

export default Navbar;
